import React, { useEffect, useState } from 'react';
import Box from '@mui/material/Box';
import { DataGrid, GridToolbar } from '@mui/x-data-grid';
import Button from '@mui/material/Button'; // Import Button from Material-UI
import axios from 'axios';
import Header from '../../components/Header';
import {allPlaceEndPoint } from '../../data/apiConstants';
import HandleException from '../../util/Toastify';
import {DeleteOutline, OpenInBrowser, OpenInNew, PinDrop} from '@mui/icons-material';
import { useTheme } from '@emotion/react';
import { tokens } from '../../theme';
import {IconButton} from "@mui/material";
import {Link} from "react-router-dom";

function Places() {
  const theme = useTheme();
  const colors = tokens(theme.palette.mode);
  const [data, setData] = useState([]);

  function openUrl(url) {
    const win = window.open(url, '_blank');
    win.focus();
  }

  const columns = [
    { field: 'id', headerName: 'ID', flex: 1, hide: true },
    { field: 'name', headerName: 'Name', flex: 1 },
    { field: 'latitude', headerName: 'Latitude', flex: 1 },
    { field: 'longitude', headerName: 'Longitude', flex: 1 },
    {
      field: 'delete',
      headerName: 'Delete',
      flex: 0.5,
      renderCell: (params) => (
          <Link to='`https://maps.google.com/?q=${params.row.latitude},${params.row.longitude}`' target="_blank">
            <IconButton color="error" onClick={() => openUrl()}>
              <OpenInNew />
            </IconButton>
          </Link>

      ),
    },
    {
      field: 'update',
      headerName: 'Update',
      flex: 0.5,
      renderCell: (params) => (
        <Button variant="outlined" color="success">
          Update
        </Button>
      ),
    },
    {
      field: 'delete',
      headerName: 'Delete',
      flex: 0.5,
      renderCell: (params) => (
        <Button variant="outlined" color="error" onClick={() => handleDelete(params.row.id)}>
          Delete
        </Button>
      ),
    },
  ];

  const fetchData = () => {
    axios.get(allPlaceEndPoint)
    .then((response) => {
      setData(response.data.result);
    })
    .catch((error) => {
      HandleException(error)
    });
  };

  useEffect(() => {
    fetchData(); // Fetch data when the component mounts
  }, []);

  const handleDelete = (id) => {
    axios.delete("")
      .then((response) => {
        fetchData();
      })
      .catch((error) => {
        HandleException(error)
      });
  };

  return (
    <Box m="20px">
      <Header
        title="Place"
        subtitle="Manage Places"
      />
        <Box>
          <Button
            sx={{
              backgroundColor: colors.blueAccent[700],
              color: colors.grey[100],
              fontSize: "14px",
              fontWeight: "bold",
              padding: "10px 20px",
            }}
          >
            <PinDrop sx={{ mr: "10px" }} />
            Add Place
          </Button>
        </Box>
      <Box
        m="40px 0 0 0"
        height="75vh"
        sx={{
          // Your styling here
        }}
      >
        <DataGrid
          rows={data}
          columns={columns}
          components={{ Toolbar: GridToolbar }}
        />
      </Box>
    </Box>
  );
}

export default Places;
